import cookies from  'next-cookies';
import {getFormData} from '../api/APIHelper';
import {Text, Box} from '@chakra-ui/core';
import '../styles/sectionReport.css';
import ReportGrades from '../components/report-components/ReportGrades';
import ReportOutcomesTable from '../components/report-components/ReportOutcomesTable';
import Head from 'next/head';
import API from '../api/api';
const sectionReport = ({user, section, course, form}) => {
    console.log(form);
    console.log("HERE"); 
    const courseTitle = form.section.courseNumber + "-00" + form.section.sectionNumber;
    return(
        <>
            <Head>
                <title>{courseTitle}</title>
            </Head>
            <div className="container">
                <Text size="xl" fontWeight="bold">ABET COURSE ASSESSMENT</Text>
                <Text size="lg">Computer Science Department - University of North Texas</Text>
                <Text size="xl" fontWeight="bold">{form.section.department} {form.section.courseNumber} {form.section.displayName}</Text>
                <Text>Course Coordinator: {form.section.coordinator.lastName}, {form.section.coordinator.firstName}</Text>
                <Box w="80%" bg="lightgreen" id="box">
                    <Text textAlign="center" fontWeight="bold">Coordinator Comments:</Text>
                </Box>
                <Box w="80%" bg="lightgray" mt="0" id="box">
                    {
                        (form.section.coordinatorComment !== "") 
                        ? <Text>{form.section.coordinatorComment}</Text>
                        : <Text textAlign="center">No comments.</Text>
                    }
                </Box>
                <Text>Course Instructor: {form.section.instructor.lastName}, {form.section.instructor.firstName}</Text>
                <Text color = "red">Undergraduate Committee should review this course.</Text>
                <ReportGrades ceGrades={form.ceGrades} csGrades={form.csGrades} itGrades={form.itGrades} />
                <ReportOutcomesTable outcomes={form.outcomes}/>
            </div>
        </>
    )
}

sectionReport.getInitialProps = async ctx => {
    const getCookies = cookies(ctx);
    new API().setToken(getCookies.token); //token will be blank in the request in getInitialProps without this call
    const section = parseInt(getCookies.section);
    const course = parseInt(getCookies.course);
    return{
        user: getCookies.user,
        section,
        course,
        form: await getFormData(getCookies.user, 2020, "FALL", "CSCE", course, section)
    }
};

export default sectionReport;
